import loadable from '@loadable/component';
// 核心系统路由
import { RoutesParams } from '../index.d';
const coreSysRoutes = (): RoutesParams[] => ([
    {path: '/test', component: loadable(() => import('@pages/test/index')), exact: true}
])
export default coreSysRoutes();
